module.exports = JSON.parse('[{"id":1,"name":"Sinigang","image":"../images/sinigang.webp","rating":4,"information":"Sinigang is a Filipino soup or stew characterized by its sour and savory taste. It is most often associated with tamarind(Filipino:sampalok), although it can use other sour fruits and leaves as the souring agent. It is one of the more popular dishes in Filipino cuisine.","ingredients":["2 lbs pork belly or buto-buto","1 bunch spinach or kang-kong","3 tablespoons fish sauce","12 pieces string bean sitaw, cut in 2 inch length","2 pieces tomato quartered","3 pieces chili or banana pepper","1 tablespoons cooking oil","2 quarts water","1 piece onion sliced","2 pieces taro gabi, quartered","1 pack sinigang mix good for 2 liters water"],"procedure":["Heat the pot and put-in the cooking oil","Saut√© the onion until its layers separate from each other","Add the pork belly and cook until the outer part turns light brown","Put in the fish sauce and mix with the ingredients","Pour the water and bring to a boil","Add the taro and tomatoes then simmer for 40 minutes or until pork is tender","Put-in the sinigang mix and chili","Add the string beans (and other vegetables if there are any) and simmer for 5 to 8 minutes","Put in the spinach, turn off the heat, and cover the pot. Let the spinach cook using the remaining heat in the pot."],"time_and_servings":{"prep_time":"10-15 minutes","cook_time":"45minutes/1hr","servings":"4-6"},"time":"../images/sinigang-time.png","nutrition":{"calories":"200","fat":"8g","carbohydrates":"15g","protein":"20g","fiber":"3g"}},{"id":2,"name":"Chicken Adobo","image":"../images/chickenadobo.jpg","rating":5,"information":"Chicken Adobo is an authentic Filipino dish and is one of the mostly recognized Filipino foods. Not to be mistaken with Mexican adobo, this dish is uniquely prepared by stewing chicken in vinegar and soy sauce.Several sources who are experts in Asian food history say that the Filipinos were already cooking adobo even before Spanish colonization. According to them, cooking with vinegar preserves the meat. This method is also considered as one of the earliest food preservation practice.","ingredients":["2 lbs chicken","3 pieces dried bay leaves","6 tablespoons soy sauce","4 tablespoons white vinegar","5 cloves garlic","1 1/2 cups water","3 tablespoons cooking oil","1 teaspoon sugar","1/4 teaspoon salt","1 teaspoon whole peppercorn"],"procedure":["Combine chicken, soy sauce, and garlic in a large bowl. Mix well. Marinate the chicken for at least 1 hour. Note: the longer the time, the better","Heat a cooking pot. Pour cooking oil.","When the oil is hot enough, pan-fry the marinated chicken for 2 minutes per side.","Pour in the remaining marinade, including garlic. Add water. Bring to a boil","Add dried bay leaves and whole peppercorn. Simmer for 30 minutes or until the chicken gets tender","Add vinegar. Stir and cook for 10 minutes.","Put in the sugar and salt. Stir and turn the heat off. Serve hot. Share and Enjoy!"],"time_and_servings":{"prep_time":"10-15 minutes","cook_time":"30-40 minutes","servings":"4-6"},"time":"../images/adobo_time.png","nutrition":{"calories":"350","fat":"15g","carbohydrates":"4g","protein":"30g","fiber":"2g"}},{"id":3,"name":"Pork Sisig","image":"../images/sisig.jpg","rating":4,"information":"Sisig originated from Pampanga. This place is considered the culinary capital of the Philippines. It was invented by Lucia Cunanan. She is popularly known as Aling Lucing and the Sisig queen. The US military bases located in the town might have played a role in the invention of this dish. People can buy cheap pig heads in commissaries because these are not normally consumed inside the base. Meat from the pig heads are scraped out, boiled, grilled, and made into what is now known as Sisig","ingredients":["1 ¬Ω lbs. pork belly boiled for 1 hour","¬Ω cup Lady\'s Choice Mayonnaise","2 pieces onion chopped","4 pieces Thai chili pepper chopped","2 pieces long green pepper chopped","16 grams Knorr SavorRich Pork equivalent to 1 sachet","¬Ω teaspoon ground black pepper","2 tablespoons soy sauce","¬º cup margarine","2 cups cooking oil"],"procedure":["Heat oil in a deep cooking pot or deep fryer. Fry the boiled pork belly until golden brown and crispy. Chop the crispy pork belly into small pieces. Set aside.","Heat half of the margarine in a pan. Saut√© half of the onions until soft. Add chopped pork. Saute for 30 seconds.","Add Knorr SavorRich. Stir and then add chili peppers and season with ground black pepper and soy sauce. Cook for 1 minute.","Add Lady\'s Choice Mayonnaise. Stir and add the remaining onion. Set aside.","Heat a metal plate (sizzling plate) on a stovetop. Melt the remaining margarine. Transfer the crispy pork sisig onto the metal plate. Let it stay for 30 seconds.","Serve with warm rice and your favorite beverage. Enjoy!"],"time_and_servings":{"prep_time":"10-15 minutes","cook_time":"30-40 minutes","servings":"4-6"},"time":"../images/sisig_time.png","nutrition":{"calories":"400","fat":"25g","carbohydrates":"15g","protein":"30g","fiber":"2g"}},{"id":4,"name":"Kare-kare","image":"../images/kare-kare.jpg","rating":5,"information":"Kare-kare is a traditional Filipino stew characterized by its rich peanut sauce. It typically includes various vegetables such as eggplant, banana flower bud (also known as banana heart), string beans, and sometimes okra. Meat options can vary but commonly include oxtail, tripe, and occasionally pork hocks or beef shanks. The dish is often served with bagoong, a fermented shrimp paste, on the side for added flavor. Kare-kare is a popular dish in Filipino cuisine and is often served during special occasions and celebrations.","ingredients":["3 lbs oxtail cut in 2-inch slices you an also use tripe or beef slices","1 piece small banana flower bud sliced","1 bundle pechay or bok choy","1 bundle of string beans cut into 2-inch slices","4 pieces eggplants sliced","1 cup ground peanuts","1/2 cup peanut butter","1/2 cup shrimp paste","34 Ounces water about 1 Liter","1/2 cup annatto seeds soaked in a cup of water","1/2 cup toasted ground rice","1 tbsp garlic minced","1 piece onion chopped","salt and pepper"],"procedure":["In a large pot, bring the water to a boil","Put in the oxtail followed by the onions and simmer for 2.5 to 3 hrs or until tender (35 minutes if using a pressure cooker)","Once the meat is tender, add the ground peanuts, peanut butter, and coloring (water from the annatto seed mixture) and simmer for 5 to 7 minutes","Add the toasted ground rice and simmer for 5 minutes","On a separate pan, saute the garlic then add the banana flower, eggplant, and string beans and cook for 5 minutes","Transfer the cooked vegetables to the large pot (where the rest of the ingredients are)","Add salt and pepper to taste","Serve hot with shrimp paste. Enjoy!"],"time_and_servings":{"prep_time":"20-30 minutes","cook_time":"2-3 hours","servings":"4-6"},"time":"../images/kare-kare_time.png","nutrition":{"calories":"450","fat":"30g","carbohydrates":"20g","protein":"25g","fiber":"5g"}},{"id":5,"name":"Tinola","image":"../images/tinola.jpg","rating":3,"information":"Tinola is a Filipino soup usually served as a main course with white rice. Traditionally, this dish is cooked with chicken or fish, wedges of papaya and/or chayote, and leaves of the siling labuyo chili pepper in broth flavored with ginger, onions and fish sauce.","ingredients":["1 whole chicken, cut into serving pieces","1 medium-sized green papaya, peeled, seeds removed, and cut into wedges","1 thumb-sized ginger, sliced","4 cloves garlic, minced","1 onion, sliced","2 tablespoons fish sauce (patis)","4 cups water or chicken broth","Salt and pepper to taste","Chili leaves (dahon ng sili) or spinach leaves for garnish","Cooking oil"],"procedure":["Saut√© the garlic, onion, and ginger","Put in the chicken and cook until the color turns light brown","Add the fish sauce. Stir. Pour rice washing into the cooking pot. Let boil. Cover the pot and simmer for 45 minutes. Note: add water if needed.","Add green papaya. Cook for 5 minutes","Add the hot pepper leaves or malunggay leaves. Stir and cook for 1 minute.","Season with ground black pepper. Note you can also add fish sauce or salt if needed.","Transfer to a serving bowl. Serve hot. Share and enjoy!"],"time_and_servings":{"prep_time":"15-20 minutes","cook_time":"30-40 minutes","servings":"4-6"},"time":"../images/tinola_time.png","nutrition":{"calories":"250","fat":"10g","carbohydrates":"15g","protein":"20g","fiber":"3g"}},{"id":6,"name":"Bicol Express","image":"../images/bicol_express.webp","rating":5,"information":"Bicol Express is a famous stew made with gata (coconut milk) and wild chilies. Traditionally, pork and balaw (shrimp paste) take centerstage, cooking in a luscious, fiery sauce. Innovative cooks, however, have come up with ways to incorporate newer ideas, such as all-seafood or pure vegetarian options.","ingredients":["1 lb. pork shoulder sliced into cubes","3 pieces long green pepper siling pansigang, sliced into thin pieces","8 pieces bird\'s eye chili siling labuyo or Thai chili, sliced into small pieces","1 piece onion sliced","4 cloves garlic crushed","1 pack Knorr Ginataang Gulay mix 45g","1 tablespoon shrimp paste bagoong alamang","3 tablespoons cooking oil","¬º teaspoon ground black pepper","2 ¬º cups water","Salt to taste optional"],"procedure":["Heat oil in a cooking pot","Saut√© garlic and onion until the onions get soft.","Add the ground black pepper and pork. Saut√© until the color turns light brown.","Pour 1 1/2 cups water. Let boil. Cover and continue to cook in medium heat until the pork gets tender and the water almost evaporates completely.","Prepare the gata by combining ¬æ cup lukewarm water and Knorr Ginataang Gulay mix. Stir until the powder dissolves completely. Set aside.","Add the long green pepper, chili pepper, and shrimp paste into the cooking pot. Stir.","Pour the gata mixture into the pot. Let boil. Cover and cook on medium heat until the liquid reduces to half. Make sure to stir once in a while.","Add salt to taste. Transfer to a serving bowl."],"time_and_servings":{"prep_time":"10-15 minutes","cook_time":"30-40 minutes","servings":"4-6"},"time":"../images/bicol-express_time.png","nutrition":{"calories":"350","fat":"25g","carbohydrates":"15g","protein":"20g","fiber":"3g"}}]');

